import { DecimalPipe } from '@angular/common';
import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { OrderService } from 'src/app/services/order.service';
import { Order } from 'src/app/shared/models/Order';

@Component({
  selector: 'app-payment-page',
  templateUrl: './payment-page.component.html',
  styleUrls: ['./payment-page.component.css']
})
export class PaymentPageComponent implements OnInit {

  order:Order=new Order()

  buttonColor = "black";
  buttonType = "buy";
  isCustomSize = false;
  buttonWidth = 240;
  buttonHeight = 40;
  isTop = window === window.top;










  paymentRequest:any = {
    apiVersion: 2,
    apiVersionMinor: 0,
    allowedPaymentMethods: [
      {
        type: "CARD",
        parameters: {
          allowedAuthMethods: ["PAN_ONLY", "CRYPTOGRAM_3DS"],
          allowedCardNetworks: ["AMEX", "VISA", "MASTERCARD"]
        },
        tokenizationSpecification: {
          type: "PAYMENT_GATEWAY",
          parameters: {
            gateway: "example",
            gatewayMerchantId: "exampleGatewayMerchantId"
          }
        }
      }
    ],
    merchantInfo: {
      merchantId: "12345678901234567890",
      merchantName: "Demo Merchant",



    },
    transactionInfo: {
      totalPriceStatus: "FINAL",
      totalPriceLabel: "Total",
      totalPrice: String(this.decimalPipe.transform(this.order.totalPrice, '1.2-2')),
      currencyCode: "USD",
      countryCode: "US",


    }
  };



  constructor(private orderService:OrderService,private router:Router,private decimalPipe: DecimalPipe){




  }
  ngOnInit(): void {
    this.orderService.getOrderForCurrentUser().subscribe({
      next:(order)=>{
        this.order=order
        console.log(this.order.totalPrice)


      },
      error:(errorResponse)=>{
         this.router.navigate(['/checkout'])
      }

    })
  }



  onLoadPaymentData(event:any){

    console.log(event.detail)
  }

}
